export const SET_USER = "SET_USER";
export const LOGOUT = "LOGOUT";


 const  setUser = (object) => ({  
    type:SET_USER,
    payload:'asif'
}); 
 const logOut = () => ({  
    type:LOGOUT
}); 

export default {
    setUser,
    logOut
}
